                    <line x1="0" y1="0" x2="60" y2="40" transform="translate(40 10.949646)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="100" stroke-dashoffset="100" pathLength="100" id="eaf-f9f1:21"></line><line x1="0" y1="0" x2="80" y2="0" transform="translate(40 10.949646)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="100" stroke-dashoffset="100" pathLength="100" id="eaf-f9f1:22"></line>
